import React from "react";
import "./style.css";

function ClickCard(props) {
  return (
    <div className="card">
      <div className="img-container">
        <img 
        alt={props.name} 
        src={props.image} />
      </div>
      <div className="content">
      </div>
    </div>
  );
}

export default ClickCard;
